class AppLib extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      categoryName: "",
      categoryId: "",
      libraryId: "",
    };
  }
  componentDidMount() {
    var classVal = document.documentElement.getAttribute("class") || "";
    classVal = classVal.concat(" appListPage");
    document.documentElement.setAttribute("class", classVal);
    const { libraryId = "", categoryId = "", projectId = "" } = GetRequest();
    this.setState({
      libraryId,
      categoryId,
      projectId,
    });
  }

  componentWillUnmount() {
    var classVal = document.documentElement.getAttribute("class");
    classVal = classVal.replace("appListPage", "");
    document.documentElement.setAttribute("class", classVal);
  }

  componentWillReceiveProps(nextProps) {
    if (!isEqual(nextProps.location, this.props.location)) {
      const { libraryId = "", categoryId = "", projectId = "" } = GetRequest();
      this.setState({
        libraryId,
        categoryId,
        projectId,
      });
    }
  }

  setCategoryName = (categoryName) => {
    if (categoryName === this.state.categoryName) return;
    this.setState({
      categoryName,
    });
  };

  render() {
    return (
      <AppConBox className="appCon">
        <div className="appSide">
          <AppSide
            {...this.props}
            {...this.state}
            setCategoryName={this.setCategoryName}
          />
        </div>
        <AppCon
          {...this.props}
          {...this.state}
          categoryName={this.state.categoryName}
        />
      </AppConBox>
    );
  }
}

export default class MDAppLibrary extends React.Component {
  render() {
    const { md = {} } = window;
    const { global = {} } = md;
    const { Account = {} } = global;
    const params = {
      accountId: Account.accountId || "",
      projects: Account.projects || [], //网络
    };
    return (
      <Router>
        <Switch>
          <Route
            path="/library"
            component={(data) => {
              return <AppLib {...this.props} {...params} {...data} />;
            }}
            title="模板库"
          />
          <Route
            path="/app/lib"
            component={(data) => {
              return <AppLib {...this.props} {...params} {...data} />;
            }}
            title="模板库"
          />
        </Switch>
      </Router>
    );
  }
}
